import React from 'react';
import { connect } from 'react-redux';
import * as actions from '../../Redux/Actions/actions.js';
import StyleChange from '../../Functions/ChangeStyles.js';

class ManagementPage extends React.PureComponent {
  render() {
    return (
      <nav className="navigationBar">
        <ul>
          <li>
            <button
              className="managementMenuButton"
              id="staffPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Staff
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="clientsPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Clients
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="servicesPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Services
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="materialsPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Materials
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="ordersPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Orders
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="promoPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Promo
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="profilesPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Profiles
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="galleryPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Gallery
            </button>
          </li>

          <li>
            <button
              className="managementMenuButton"
              id="feedbacksPage"
              onClick={(e) => {
                this.props.getAll(e.target.id);
                StyleChange(e.target.id);
              }}
            >
              Feedbacks
            </button>
          </li>
        </ul>
      </nav>
    );
  }
}

function mapStateToProps(state) {
  return {};
}

function mapDispatchToProps(dispatch) {
  return {
    getAll: (id) => dispatch(actions.FeetchAllData(id)),
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(ManagementPage);
